import React from 'react';
import './nav-bar.styles.css';
const NavBar = ({onRouteChange, currentRoute}) => {
    return (

      <nav className='container' >

        {
          currentRoute === 'signin' ?
            <div className="options">
              <p className='option' onClick={() => onRouteChange('signin')}> Sign In </p>
            </div>
            :
            <div className="options">
              <p className='option' onClick={() => onRouteChange('home')}> Home </p>
              <p className='option' onClick={() => onRouteChange('signin')}> Sing out</p>
            </div>

        }
      </nav>
    )
  

};

export default NavBar;
